import { Field,reduxForm } from 'redux-form';
import { connect } from 'react-redux';

const App = () => {
    const [username, setUserName] = useState("");
    const [email, setEmail] = useState("");
    const [phone, setPhone] = useState("");
    const [address, setAddress] = useState("");

    const {handleSubmit,Submitting} = props;

    return(
        <div className="App">
            <center><h1>Registration Form</h1></center>
            <form onSubmit={handleSubmit}>
                <div className="row">
                    <div className="col-md-6">
                      <Field type="text" name="username" component="input" label="Enter UserName"/>
                        </div>
                </div>

                <div className="row">
                    <div className="col-md-6">
                      <Field type="text" name="email" component="input" label="Enter Email"/>
                        </div>
                </div>

                <div className="row">
                    <div className="col-md-6">
                      <Field type="text" name="phone" component="input" label="Enter Phone Number"/>
                        </div>
                </div>

                <div className="row">
                    <div className="col-md-6">
                      <Field type="text" name="address" component="input" label="Enter Address"/>
                        </div>
                </div>
                <button type="button" disabled ={submitting}>Submit</button>
            </form>
        </div>
    )
}
export default App;
